last of old school You were very lucky and I agree, although I would argue the 84 tour is probably truley last of the old school Dead Head scene on the road with the band albeit alot  bigger from previous tour. I think 1983 was a first for alot Heads. A new generation, I wasn't old enough 12 at the time. In my opinion 82 was the end of an era for the Heads that attended the shows in the 70's. If you like this stuff, the early 80's vibe check out the poplar creek 83 that's old school by definition and the Madison show in 83'. While your at it, my all time favorite run of three venues back to back. The Greek,Saratoga and Merriweather in 1983 is the epitomy of killer GD and if you think they lost it in 84 check out the Marin Spring shows in Jerrys back yard. That run along with Fall 84 mainly Augusta and Berkeley thats top 10 old school Dead in my book. Anyway, The rumors and reality of Jerry partying as hard as the crowd or harder made it all the while crazier. Big Boss all wacked out crushin tune after tune. This was gonzo shit here at Spaceship Hampton a couple years before 20yr tour in 85 and touch of Grey radio hit, war on drugs and just plain ole' huge success in popularity.Hey lets go dose in the parking lots and fields of this Grateful Dead concert shit Iam hearing about. What do they sound like whats the music like?  "nothin like a Grateful Dead show" what's that all about? I don't know but there playin' out at Alpine this summer (87) there's a bunch of freaks and hot hippie chics traveling around city to city with good drugs and all the beer you can drink (some oat-meal stout?) So there you have it blame it on grateness. It was a beatiful thing going on underground and the masses found out about it and soon caught up. St. Jerry falls for the first time and a re-vived Dead hit the streets hard in the late 80's an slowly but surely there you have it, no longer will you be in the company of Phil dropping bombs on a intimate crowd of maybe 50 shroomed out Heads during a sound check.  

   }}}Gone are the days{{{

